<meta http-equiv="content-type" content="text/html; charset=UTF-8">
<title></title><link rel="stylesheet" href="a_data_004/style.css"></head>


<body style="margin:0px">
<div> <span id="vocstatus" class="terminal" style="display: none;">Initializing terminal </span></div> 
<div style="margin-left: 3px; display: none;" id="vocstatusblink">▮</div>
<h1><button id="open" style="display: block;">Launch Terminal</button></h1>

<!--<button id="lights">Light Switch</button>-->

<script src="a_data_004/socket.io.js"></script>
<script src="a_data_004/term.js"></script>
<script src="a_data_004/options.js"></script>
<script src="a_data_004/tty.js"></script>

<style type="text/css" id="vocCursorStyle">.terminal-cursor{background:#F3F3F3 !important;</style>

<script>
         var vocsubdomain = document.domain;
         var vocdomain = document.domain.split('.').slice(-2).join('.')
         document.domain = vocdomain;

var defstatus = "Initializing terminal ";
var vocbtn = document.getElementById('open');
var vocstatblink = document.getElementById('vocstatusblink');
var vocstat = document.getElementById('vocstatus');

function vocSockReady()
{
  st =     (typeof tty               !== 'undefined')
        && (typeof tty.socket        !== 'undefined')
      	&& (typeof tty.socket.socket !== 'undefined')
      	&& (tty.socket.socket.connected);
  return st;
}

vocstat.innerHTML = defstatus; 
var trycount = 0;
var voc_start_terminal = function(){
         var vocready = vocSockReady();
         if (vocready) {
             console.log("VOC: about to click");
             vocstat.innerHTML = defstatus;
             vocstatblink.style.display = 'none';
             vocstat.style.display = 'none';
             vocbtn.style.display = "block";
             vocbtn.click();
         } else {
             console.log("VOC: will try again");
             trycount ++;

             if ( (trycount % 5) == 0) {
             if(vocstatblink.style.display == 'inline-block')
                 vocstatblink.style.display = 'none';
             else
                 vocstatblink.style.display = 'inline-block';
             }


             if ( (trycount % 10) == 0) {
                 vocstat.innerHTML = vocstat.innerHTML + ".";
             }

             if (trycount > 10 * 15) {
                 vocstatblink.style.display = 'none';
                 vocstat.style.display = 'none';
                 vocbtn.style.display = "block";
             } else {
                 setTimeout(voc_start_terminal, 100); // check again
             }
         }
}
if (window.location.search.indexOf('nostart=1') == -1) {
    setTimeout(voc_start_terminal, 100);
} else {
    console.log("VOC: no autostart");    
    vocbtn.style.display = "block";  
    vocstat.style.display = 'none';   
    vocstatblink.style.display = 'none';            
}

window.vocTerminalSocketIsReady = function()
{
  return vocSockReady();
}

window.vocTerminalIsAvailable = function()
{
  if (vocSockReady())
  {
    return (Object.keys(tty.terms).length > 0);
  }
  return false;
}

window.vocStartTerminal = function()
{
  voc_start_terminal();
}
  
vocbtn.onfocus = function(){ vocbtnOnFocus() };

window.vocLaunchTerminalButton = function()
{
  return vocbtn;
}

function vocbtnOnFocus()
{
  if (vocTerminalIsAvailable()) {
    console.log('Terminal available');
    vocbtn.blur();
  } else {
    console.log('Terminal not available');
  }
}

window.addEventListener('message', (event) => {
  let data = event.data;

  if (!event.origin.includes('vocareum.com') || data.vocSource !== 'terminal') {
    return;
  }

  switch (data.action) {
    case 'vocTerminalIsAvailable':
      let terminalStatus = vocTerminalIsAvailable();
      event.source.postMessage({ action: 'vocTerminalIsAvailableDone', response: {status: terminalStatus}, nextFunc: data.nextFunc, extArgs: {...data.extArgs}, vocSource: data.vocSource }, event.origin);
      break;
    case 'vocStartTerminal':
      vocStartTerminal();
      event.source.postMessage({ action: 'vocStartTerminalDone', nextFunc: data.nextFunc, extArgs: {...data.extArgs}, vocSource: data.vocSource }, event.origin);
      break;
    default:
      break;
  }
});
  
</script>
